import React, { useState } from 'react';
import '../css/Member_search.css';

const MemberSearch = () => {
    const [email, setEmail] = useState('');
    const [name, setName] = useState('');
    const [id, setId] = useState('');

    return (
        <div className='search-background'>
    <div className='search-form'>
        <div className='header'>아이디/비밀번호 찾기</div>
        <div>회원 아이디와 비밀번호를 잊으셨나요?</div>

        <div className='input-group'>
            <label htmlFor="name">이름을 입력해 주세요</label>
            <input type="text" id="name" placeholder="이름" />
        </div>

        <div className='input-group'>
            <label htmlFor="email">이메일 입력해 주세요</label>
            <input type="email" id="email" placeholder="이메일" />
        </div>

        <button className='button'>아이디 찾기</button>

        <div className='input-group'>
            <label htmlFor="id">아이디를 입력해 주세요</label>
            <input type="text" id="id" placeholder="아이디" />
        </div>

        <div className='input-group'>
            <label htmlFor="name2">이름을 입력해 주세요</label>
            <input type="text" id="name2" placeholder="이름" />
        </div>

        <div className='input-group'>
            <label htmlFor="email2">이메일 입력해 주세요</label>
            <input type="email" id="email2" placeholder="이메일" />
        </div>

        <button className='button'>비밀번호 찾기</button>

        <div className='footer'>회원가입 시 입력한 연락처 정보로 아이디를 보내드립니다.</div>
    </div>
</div>

    ); 
};

export default MemberSearch;
